import React,{Component} from 'react';
import Table from 'react-bootstrap/Table'
import BootstrapTable from "react-bootstrap-table-next";
import './App.css';

class App extends Component {
   data = [];
  componentDidMount() {
    fetch('http://localhost:4000/properties')
    .then(res => res.json())
    .then((data) => {
      this.data = data;
    })
    .catch(console.log)
  }
  render() {
    return (
       <table>
         <tbody>
           {
                this.data.map((numList,i) =>(
                   <tr key={i}>
                    {
                      numList.map((num,j)=>
                         <td key={j}>{num}</td>
                      )
                    }
                   </tr>
                ))
           }
         </tbody>
       </table>
    );
  }
}

export default App;
